      '[[["there is a difference between async and parallism. js\'s async is not parallalism"],null],[[],null],[["\\"",{"_":"non-parallelism would be like you waiting in line at amusement park for a roller coaster. Lots of people in line, the roller coaster has 30 seats on it but  only one person can ride at any given ","tags":[["span",{"style":{"color":"#e6e6e6"}}]]},"moment"],null],[["on the other hand, if",{"_":" 30 people are experiencing the roller coaster at exactly the same instant. That\'s more parallelism","tags":[["span",{"style":{"color":"#e6e6e6"}}]]},"\\""],null],[[],null],[["- ",{"_":"in a computing sense, parallelism is expressed through threads","tags":[["span",{"style":{"color":"#e6e6e6"}}]]}],null],[[{"_":"in asynchronicity, our js program runs only on a single thread even though the browser may have access to multiple threads and even the JavaScript engine node for example could use hundreds of threads in the background.","tags":[["span",{"style":{"color":"#e6e6e6"}}]]}],null],[[{"_":"at any given instant there is only one line of JavaScript running in the JavaScript engine","tags":[["span",{"style":{"color":"#f1c8c8"}}]]}],null],[[],null],[["- we ",{"_":"could in theory spend multiple instances of the JavaScript engine on entirely separate threads, but they couldn\'t communicate in any useful way","tags":[["span",{"style":{"color":"#e6e6e6"}}]]}],null],[[],null],[["w",{"_":"eb workers are an example of trying to bridge that gap, but that\'s not a JavaScript thing, that\'s a browser thing","tags":[["span",{"style":{"color":"#e6e6e6"}}]]}],null],[["as far as js is concerned, ",{"_":"those two things don\'t know about each other they don\'t have any overlap, they\'re not sharing variables","tags":[["span",{"style":{"color":"#e6e6e6"}}]]},", however ",{"_":"web workers do give us a communication path through asynchronous events","tags":[["span",{"style":{"color":"#e6e6e6"}}]]},", which themselves rely ",{"_":"on the single threaded notion through the event loop","tags":[["span",{"style":{"color":"#e6e6e6"}}]]}],null]]',
